import React from 'react';
import { Table, Container } from 'react-bootstrap';

const ProjectsPage = () => {
  // Mock data for projects
  const projects = [
    { id: 1, name: 'Projekt 1', description: 'Opis projektu 1', createdDate: '2023-06-01', deadline: '2023-07-01' },
    { id: 2, name: 'Projekt 2', description: 'Opis projektu 2', createdDate: '2023-06-05', deadline: '2023-07-15' },
  ];

  return (
    <Container>
      <h2>Strona "Projekty"</h2>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Nazwa</th>
            <th>Opis</th>
            <th>Data utworzenia</th>
            <th>Termin</th>
          </tr>
        </thead>
        <tbody>
          {projects.map((project) => (
            <tr key={project.id}>
              <td>{project.name}</td>
              <td>{project.description}</td>
              <td>{project.createdDate}</td>
              <td>{project.deadline}</td>
            </tr>
          ))}
        </tbody>
      </Table>
    </Container>
  );
};

export default ProjectsPage;
